import "./WorkCardStyles.css";
import React from 'react';

const WorkCard = () => {
  return (
    <div className="work-container">
        <h1 className="project-heading">Projects</h1>
        <div className="project-container">
            <div className="project-card">
                <img src="" alt="image"/>
            </div>
        </div>

    </div>
  )
}

export default WorkCard
